import React, { useState } from 'react';
import './FrontPage.css';
import { Link } from 'react-router-dom';
import axios from 'axios'; // Import Axios

const columns = [
    { key: 'firstName', label: 'FIRSTNAME' },
    { key: 'lastName', label: 'LASTNAME' },
    { key: 'email', label: 'EMAIL' },
    { key: 'mobileNumber', label: 'MOBILENUMBER' },
    { key: 'dob', label: 'DOB' },
];

function FrontPage() {
    const [employeeData, setEmployeeData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        mobileNumber: '',
        dob: '',
    });

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            // Make a POST request to your Add Employee API
            const response = await axios.post('your_add_employee_api_url', employeeData);

            // Handle the response as needed
            console.log('Employee added successfully:', response.data);

            // Clear the form or perform any other actions
            setEmployeeData({
                firstName: '',
                lastName: '',
                email: '',
                mobileNumber: '',
                dob: '',
            });
        } catch (error) {
            console.error('Error adding employee:', error);
        }
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setEmployeeData({
            ...employeeData,
            [name]: value,
        });
    };

    return (
        <div className="App">
            {/* ... your existing code ... */}
            <div className="form">
                <form onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label htmlFor="firstName">First Name:</label>
                        <input
                            type="text"
                            id="firstName"
                            name="firstName"
                            value={employeeData.firstName}
                            onChange={handleInputChange}
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="lastName">Last Name:</label>
                        <input
                            type="text"
                            id="lastName"
                            name="lastName"
                            value={employeeData.lastName}
                            onChange={handleInputChange}
                        />
                    </div>
                    {/* Add input fields for other employee details */}
                    <button type="submit">Add Employee</button>
                </form>
            </div>
        </div>
    );
}

export default FrontPage;
